import logo from './components/BK-plant-logo.png';
import React from 'react';
import ReactDOM from 'react-dom';
import './Style/Semantic/semantic.css'

function search(){
    var searchbar = document.getElementById("search_bar");
    return(

        <div className='ui search item'>
            <div className='ui icon input'>
                <input className='prompt' type="text"/>
            </div>
            <div className="results"></div>
        </div>

    );
}

function App() {
    return (
        <div className="ui huge top fixed menu">
            <div className='item'>
                <img src={logo}/>
            </div>
            <a className='item'>Home</a>
            <a className='item'>Resource</a>
            <a className='item'>About Us</a>
            <div className='right menu' id="search_bar">
                <a className='item' href='#' onClick={search()}><i className='search icon'></i></a>
                <a className='item'><i className='user circle outline icon'></i></a>
            </div>
        </div>
    );
}

